import React, { useState } from 'react';
import { Link } from 'react-router-dom';


function ContactUs() {
  const [email, setEmail] = useState('');
  const [questions, setQuestions] = useState('');

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handleQuestionsChange = (e) => {
    setQuestions(e.target.value);
  };

  const handleSendMessage = () => {
    if (email && questions) {
      // Send data to the server using fetch
      fetch('/your-php-script.php', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/x-www-form-urlencoded',
        },
        body: new URLSearchParams({ email, questions }),
      })
        .then((response) => response.text())
        .then((data) => {
          alert(data); // Display the response from the server
        })
        .catch((error) => {
          console.error('Error:', error);
        });
    } else {
      alert('Please enter your email and questions.');
    }
  };




  return (
    <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/Blog">Blog</Link>
        <Link to="/contactus">Contact Us</Link>
        <Link to="/services">Services</Link>
        <Link to="/login">Login</Link>
      </nav>
      <div className="container">
        <div className="content">
          <div className="text">
            <center>
              <h2>CONTACT US</h2>
            </center>
            <div className="login-box">
              <div className="box-heading">Email:</div>
              <input
                type="email"
                className="box-input"
                placeholder="Enter your email"
                value={email}
                onChange={handleEmailChange}
              />
              <div className="box-heading">Your Questions:</div>
              <input
                type="text"
                className="box-input"
                placeholder="Enter your questions"
                value={questions}
                onChange={handleQuestionsChange}
              />
              <div className="box-send">
                <button onClick={handleSendMessage}>SEND</button>
              </div>
            </div>
          </div>
        </div>
      </div>
      <footer>
        <p>&copy; Copyright MS in DS Academic Program</p>
      </footer>
    </div>
  );
}

export default ContactUs;
